import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div>
      <h1>Ласкаво просимо до CosmeticShop!</h1>
      <p>Тут можна знайти все необхідне для догляду за шкірою, макіяжу та краси.</p>
      <Link to="/catalog">Перейти до каталогу</Link>
    </div>
  );
}

export default HomePage;
